import './App.css';

export default class App extends Component {
  render() {
    return (
      <div className='App'>
        <Header Den={this.Den} Ben={this.Ben} st={this.state.vernagirmek} />
        <h1>{this.state.vernagirmek}</h1>
      </div>
    );
  }
}
